function loadExternalJS() {
    // 필요한 파일들을 동적으로 생성해줍니다.
    const scriptJquery = document.createElement("script");
    scriptJquery.src = "https://cdnjs.cloudflare.com/ajax/libs/jquery/3.3.1/jquery.min.js";
    scriptJquery.async = true;
    
    const scriptJquery2 = document.createElement("script");
    scriptJquery.src = ".https://cdnjs.cloudflare.com/ajax/libs/easy-pie-chart/2.1.6/jquery.easypiechart.min.js";
    scriptJquery.async = true;
    
    // 생성된 script 요소들을 body에 붙여주세요
    document.body.appendChild(scriptJquery);
    document.body.appendChild(scriptJquery2);
    document.body.appendChild(scriptPlugin);
  }
  
  export default loadExternalJS;
